import collections


class Node:
    def __init__(self, data):
        self.data = data
        self.children = dict()
        self.indices = dict()


class Solution:
    def __init__(self):
        self.root = Node(None)
        self.table = dict()
        self.visited = set()

    def insert(self, string):
        if not string:
            return None
        if string in self.table:
            return self.table[string]
        node = self.root
        for s in string:
            if s not in node.children:
                node.children[s] = Node(s)
                node.children[s].indices[s] = 0
                node = node.children[s]
            else:
                node = node.children[s]
                node.indices[s] += 1
        self.table[string] = node
        return node

    def find_next(self, node):
        if not node:
            return None
        if node.indices == 0:
            return None
        if node.indices == len(node.children) - 1:
            return self.find_next(node.children[node.data])
        max_value = -1
        res = None
        for k, v in node.indices.items():
            if v == max_value and res is None:
                res = k
            if v > max_value:
                max_value = v
                res = k
        return self.find_next(node.children[res])

    def solve(self, q: int, query: list) -> str:
        res = []
        for i in range(q):
            stdin = query[i * 3]
            m = int(query[i * 3 + 1])
            b = [int(x) for x in query[i * 3 + 2].split(' ')]
            self.root = self.insert(stdin)
            node = self.insert(stdin)
            self.visited = set()
            self.visited.add(node)
            for j in range(m):
                node = self.insert(stdin)
                self.visited.add(node)
                node.indices[self.find_next(node)] -= 1
            res.append(self.find_next(self.root))
        return '\n'.join(res)

