class BrainfuckInterpreter:
    def __init__(self, program):
        self.cells = [0] * 30000
        self.pos = 0
        self.inputs = []
        self.output = ''
        self.program = program
        self.commands = {
            '+': self.sum,
            '-': self.sub,
            '>': self.inc,
            '<': self.dec,
            '[': self.open_bracket,
            ']': self.close_bracket,
            ',': self.put_input,
            '.': self.get_output
        }

    def open_bracket(self):
        self.cells[self.pos] += 1
        self.pos += 1

    def close_bracket(self):
        self.pos -= 1
        if self.cells[self.pos] == 0:
            return True
        self.cells[self.pos] -= 1

    def inc(self):
        self.cells[self.pos] += 1

    def dec(self):
        self.cells[self.pos] -= 1

    def sum(self):
        self.cells[self.pos] += self.cells[self.pos + 1]

    def sub(self):
        self.cells[self.pos] -= self.cells[self.pos + 1]

    def put_input(self):
        self.inputs.append(self.cells[self.pos])

    def get_output(self):
        self.output += chr(self.cells[self.pos])
        self.pos += 1

    def step(self):
        op = self.program[self.pos]
        if op in self.commands:
            self.commands[op]()

    def run(self):
        i = 0
        while i < len(self.program):
            self.step()
            i += 1
        return self.output

