        self.a_counter = Counter(self.a)
        self.b_counter = Counter(self.b)
        self.a_len = len(self.a_counter)
        self.b_len = len(self.b_counter)

    def run(self) -> str:
        self.b_counter = Counter(self.b)
        self.a_counter[self.b[0]] -= 1
        self.b_counter[self.a[0]] -= 1
        if self.a_counter[self.b[0]] >= 0:
            self.a_counter[self.b[0]] -= 1
        if self.b_counter[self.a[0]] >= 0:
            self.b_counter[self.a[0]] -= 1
        if self.b_counter[self.b[0]] >= 0:
            self.a_counter[self.b[0]] -= 1
        if self.a_counter[self.b[0]] >= 0:
            self.b_counter[self.a[0]] -= 1
        if self.a_counter[self.b[0]] >= 0:
            self.a_counter[self.b[0]] -= 1
        self.a_counter[self.a[0]] += 1
        self.b_counter[self.b[0]] += 1
        self.a_counter[self.b[0]] += 1
        self.b_counter[self.a[0]] += 1

        self.a_counter[self.a[0]] += 1
        self.b_counter[self.b[0]] += 1

        if self.a_counter[self.a[0]] >= 0 and self.b_counter[self.b[0]] >= 0:
            self.ans = min(self.ans, 2 * self.a_len)
        if self.a_counter[self.a[0]] >= 0 and self.b_counter[self.b[0]] < 0:
            self.ans = min(self.ans, self.a_len)
        if self.a_counter[self.a[0]] < 0 and self.b_counter[self.b[0]] >= 0:
            self.ans = min(self.ans, self.b_len)
        if self.a_counter[self.a[0]] < 0 and self.b_counter[self.b[0]] < 0:
            self.ans = min(self.ans, abs(self.a_counter[self.b[0]]) + abs(self.b_counter[self.a[0]]))
        return str(self.ans)
